Психолог, женский коуч, православная, счастливая жена и мама в кубе.

Если вы — просто женщина, которая хочет изменить свою жизнь, научиться видеть счастье и просто быть счастливой! 

Если это про Вас: 

💞 Запутались в отношениях с партнёром и не понимаете, чего от них хотите и как их улучшить;

💞 Хотите, но не можете построить новые отношения с партнером;

💞 Чувствуете, что упускаете связь со своим ребенком, но понимаете важность теплых отношений с ним;

💞 Ощущаете свою жизнь как “день сурка” и хотели бы ярких и позитивных изменений;

💞Не умеете распределять время и вам кажется, что ничего не успеваете, а дела валятся, как снежный ком;

В ТАКОМ СЛУЧАЕ ПРИГЛАШАЮ ВАС НА КОНСУЛЬТАЦИЮ ИЛИ СЕРИЮ КОНСУЛЬТАЦИЙ с использованием МАК - метафорических ассоциативных карт, в ходе которых:

♻ Поймёте конкретные шаги, которые помогут улучшить отношения с мужем (партнёром), ребенком;

♻ Осознаете, что и как делать, чтобы построить новые отношения;

♻Увидите способы, которые помогут “раскрасить” жизнь, сделать ее радостней и счастливей;

♻Научитесь эффективно пользоваться временем, распределять дела по приоритетам, в следствии чего жизнь станет более четкой и структурированной.

ПЕРВАЯ КОНСУЛЬТАЦИЯ БЕСПЛАТНО! 

Консультации провожу ОНЛАЙН (Skype, What’sapp, Viber). 

Просто напишите мне!
